	/**
	 * This method is used to send push-notification based on vehicle year & model.	
	 * @param pushNotificationVo
	 * @param year
	 * @param model
	 * @return status
	 */
	public PushNotificationVO sendNotification(
			PushNotificationVO pushNotificationVo ,String year,String model) {
		
		PushNotificationVO pushVo=new PushNotificationVO("failure");
		//Fetch list of device tokens from db corresponding to supplied device type 
		//Then save notification details to db
		//send required push notifications
		
		ArrayList<String> deviceTokens=getDeviceTokensList(pushNotificationVo.getDevicetype(),year,model);
		logger.debug("No of devices to push notify : "+deviceTokens.size());
		
		if(deviceTokens.size()>0)
		{	
		boolean isSaved=savePushNotification(pushNotificationVo, getDeviceTokensAsString(deviceTokens));
		
			if(isSaved)
			{
				pushVo.setStatus("success");
				
				String pushMessage=pushNotificationVo.getPushtitle()+" - "+pushNotificationVo.getPushmessage();
				
				if(pushNotificationVo.getDevicetype().equalsIgnoreCase("iphone"))
				{
					pushToIphone(pushMessage, deviceTokens);
					logger.debug(">>Send push to IPHONE");	
				}
				else
				{
					notifyAndroid(pushMessage, deviceTokens);
					logger.debug(">>Send push to ANDROID");	
				}
			}

		}
		return pushVo;
	}
   
	
