	 private void sendRecallNotificationToAndroid(String messageToSend, String vin, String dealerCode,String dealerName, ArrayList<String> devicesList)
		{
			logger.debug(">>>>>>>Start sendRecallNotificationToAndroid");

			try {

				Sender sender = new Sender(appConstants.MMG_PUSHNOTIFICATION_ANDROID_KEY);
				
				Message message = new Message.Builder()
				.collapseKey("1") 
				.timeToLive(120)  //Time in seconds to keep message queued if device offline.
				.delayWhileIdle(true) // Wait for device to become active before sending.
				.addData("message",messageToSend)
				.addData("vin", vin)
				.addData("dcode", dealerCode)
				.addData("dname", dealerName)
				.build();
				
				
				// Use this for multicast messages
				MulticastResult result = sender.send(message, devicesList, 1);
				
				logger.debug("Push send result = "+result.toString());
				
				if (result.getResults() != null) {
					if (result.getFailure() == 1){
						logger.debug("RECALL NOTIFICATION FAILED TO ANDROID: {} " +
	                            devicesList.get(0) + "Vin {}:"+vin);
						logger.debug(result.getResults().toString());
					}
					if (result.getSuccess() == 1){
						pushNotificationCount++;
						//int canonicalRegId = result.getCanonicalIds();
						logger.debug("RECALL NOTIFICATION SENT SUCCESSFULLY TO ANDROID: {} " +
                            devicesList.get(0) + "Vin {}:"+vin);
						logger.debug(result.getResults().toString());
					/*if (canonicalRegId != 0) {
					}*/
					}
				} else {
					int error = result.getFailure();
					logger.debug("RECALL NOTIFICATION FAILED TO ANDROID: {} " +
                            devicesList.get(0) + "Vin {}:"+vin);
					logger.debug(result.getResults().toString());
					logger.debug("error - "+error);
				}
			} catch (Exception e) {
				logger.debug("Exception created while sending recall notifications to android : "+e.getMessage());
				logger.error("Exception created while sending recall notifications to android : "+e);
			}
			
			logger.debug(">>>>>>>End sendRecallNotificationToAndroid");
			
		}

