	/**
	 * Used to save notification details to database.
	 * @param pushNotificationVo
	 * @param deviceTokens
	 * @return true/false
	 */
	private boolean savePushNotification(PushNotificationVO pushNotificationVo,String deviceTokens) {

		boolean status=false; 
		
		Connection conn=null;
		PreparedStatement stmt=null;
		
		try{
		conn=dataSource.getConnection();
		String query="INSERT INTO mmg_pushnotifications(push_title, push_message, push_devices, last_update_date)VALUES(?, ?, ?, current_timestamp)";
		stmt=conn.prepareStatement(query);
		stmt.setString(1,pushNotificationVo.getPushtitle());
		stmt.setString(2,pushNotificationVo.getPushmessage());
		stmt.setString(3,deviceTokens);


		int temp=stmt.executeUpdate();
		logger.debug("No of affected records : "+temp);
		status=true; 
		}catch(Exception e){
			logger.error("Problem -  savePushNotification > "+e);
		}
		finally{
		    try { stmt.close(); } catch (Exception e) { logger.error(e.getMessage()); }
		    try { conn.close(); } catch (Exception e) { logger.error(e.getMessage()); }			
		}		
	
		return status;
	}

	
