	/**
	 * Used to verify if a device is registered or not.
	 * @param deviceType
	 * @param deviceToken
	 * @return true/false
	 */
	private boolean isDeviceRegistered(String deviceType, String deviceToken) {
		Boolean isPresent=false;

		Connection conn=null;
		PreparedStatement stmt=null;
		ResultSet resultSet=null;
		
		try{
		conn=dataSource.getConnection();
		String query="SELECT device_token FROM mmg_devices where device_type=? and device_token=?";

		stmt=conn.prepareStatement(query);
		stmt.setString(1,deviceType);
		stmt.setString(2,deviceToken);
		
		resultSet=stmt.executeQuery();
		
			if(resultSet.next())
			{
				isPresent=true;	
				logger.debug("Device token {} is alredy registered.",deviceToken);
			}
		
		}catch(Exception e){
			logger.error(" Problem -  isDeviceRegistered > "+e);
		}
		finally{
		    try { resultSet.close(); } catch (Exception e) { logger.error(e.getMessage());}
		    try { stmt.close(); } catch (Exception e) { logger.error(e.getMessage()); }
		    try { conn.close(); } catch (Exception e) { logger.error(e.getMessage()); }			
		}		

		return isPresent;
	}


	
	/**
	 * Returns list of device tokens based on device type.
	 * @param deviceType
	 * @return list of device tokens
	 */
	private ArrayList<String> getDeviceTokensList(String deviceType,String year,String model) {
		
		ArrayList<String> tokensList=new ArrayList<String>();

		Connection conn=null;
		PreparedStatement stmt=null;
		ResultSet resultSet=null;
		
		try{
		conn=dataSource.getConnection();
		String query="SELECT device.device_token FROM mmg_devices device inner join mmgusers muser on muser.usermailid=device.device_user inner join mmguservehicles uservehicle on uservehicle.userid_ident=muser.user_ident inner join mmgvehicle_vin mvin on mvin.vin=uservehicle.custvin inner join mmgvehiclecode vehicle on vehicle.vehiclecode_ident=mvin.vehiclecode_ident where upper(device.device_type)=? AND vehicle.vehicle_year=? AND vehicle.vehicle_model=? group by device.device_token";
		stmt=conn.prepareStatement(query);
		stmt.setString(1,deviceType.toUpperCase());
		stmt.setString(2,year);
		stmt.setString(3,model);
		
		resultSet=stmt.executeQuery();
		
			while(resultSet.next())
			{
				tokensList.add(resultSet.getString(1));
			}
		
		}catch(Exception e){
			logger.error(" Problem -  getDeviceTokensList > "+e);
		}
		finally{
		    try { resultSet.close(); } catch (Exception e) { logger.error(e.getMessage());}
		    try { stmt.close(); } catch (Exception e) { logger.error(e.getMessage()); }
		    try { conn.close(); } catch (Exception e) { logger.error(e.getMessage()); }			
		}		

		return tokensList;
	}
	

	/**
	 * Converts list of device tokens into string of ~ separated device tokens.
	 * @param tokensList
	 * @return string
	 */
	private String getDeviceTokensAsString(ArrayList<String> tokensList) {
		
		StringBuffer temp=new StringBuffer();
		for(String token:tokensList)
		{
			temp.append("~").append(token);
		}
		String tokenStr=temp.substring(1).toString();
		
		return tokenStr;
	}


