	public boolean updateMmgRecallPushData(ClosedRecallsResponseVO closedRecallsResponseVO)
	{
		boolean updateStatus = false;
		Connection conn=null;
		Statement stmt=null;
		try{
			conn=dataSource.getConnection();
			conn.setAutoCommit(false);
			stmt=conn.createStatement();
		
			for (int i=0;i<closedRecallsResponseVO.getClosedRecallList().size();i++){
				String rcllNo = closedRecallsResponseVO.getClosedRecallList().get(i).getRecallNo();
				String vin = closedRecallsResponseVO.getClosedRecallList().get(i).getVin();
			
				String updateQuery = "UPDATE mmgrecallpushdata SET rcll_status='CL',notification_flg='N' where rcll_no="+"'"+rcllNo+"'"+"  AND vin_cd="+"'"+vin+"'";
				stmt.addBatch(updateQuery);
			}
			int[] updateRow=stmt.executeBatch();
			logger.debug(" No of affected rows in mmgrecallpushdata= ",updateRow);
				
			conn.setAutoCommit(true);
			updateStatus = true;
			
		}catch(Exception e){
			updateStatus = false;
			saveToMmgRecallHistory(0,"N");
			updateJobRunningStatus("N");
			logger.error(" Updating failed -  updateMmgRecallPushData > "+e);
			try {
				conn.rollback();
				conn.setAutoCommit(true);
			} catch (SQLException e1) {
				e1.printStackTrace();
			}
		}finally{
		    try { stmt.close(); } catch (Exception e) { logger.error(e.getMessage()); }
		    try { conn.close(); } catch (Exception e) { logger.error(e.getMessage()); }			
		}		
		logger.debug("<<< exiting updateMmgRecallPushData");
		
		return updateStatus;
	}
	
	
	public boolean recallPushnotificaionData()
	{
		VehiclesRecallResponseVO vehiclesRecallResponseVO = null;
		boolean status = false;
		String pushNotificationSuccessStatus = "N";
		this.pushNotificationCount = 0;
		boolean isSaved = true;
		
		List<MmgRecallControlTableVO> mmgRecallControlTableVO = null;
		
		try {
			//If jobrunningstatus is Y then continue with open recall
			List<MMgRecallJobExecutionTableVO> jobExecutionTableList = getJobExecutionTableDetails();
			if(jobExecutionTableList.size()>0 && jobExecutionTableList.get(0).getJobEnableStatus().trim().equalsIgnoreCase("Y") && 
					jobExecutionTableList.get(0).getJobRunningStatus().trim().equalsIgnoreCase("Y")){
			
			//Read from control table
			mmgRecallControlTableVO = mmgRecallControlService.getRecallControlTableData();
			
			Map<String,String> recallControlMap = buildRecallControlMap(mmgRecallControlTableVO);
			if(null!=recallControlMap && recallControlMap.size()>0){	
				//Call recall details web service
				vehiclesRecallResponseVO=getVehicleRecallInfo(recallControlMap);
				
				if(null!=vehiclesRecallResponseVO && null!=vehiclesRecallResponseVO.getVehicalsList()){
					//add or update mmgrecallpushdata
					isSaved = addOrUpdateRecallsToPushData(vehiclesRecallResponseVO,recallControlMap);
				}
					
					if(isSaved){
						if(appConstants.MMG_RECALL_PUSHNOTIFICATION_ENABLED){
						
							logger.debug("Recall push notification flag in property file set to true");
							boolean isUpdated = updateMmgRecallPushDataOnCtrlParams(recallControlMap);
							//If update mmgRecallPushData is successful get eligible devices by joining tables
							if(isUpdated){

								ArrayList<DeviceTokenDetailsVO> deviceTokenDetails = getDeviceTokenDetails();
						
								if(deviceTokenDetails != null && deviceTokenDetails.size()>0){		
									ArrayList<String> androidDevices = new ArrayList<String>();
									ArrayList<String> iPhoneDevices = new ArrayList<String>();
								
									for(int i=0;i<deviceTokenDetails.size();i++){
										String message = "There is a safety recall on your " +deviceTokenDetails.get(i).getCrlnName()+ ". Open to view details and schedule service.";
									
										if(deviceTokenDetails.get(i).getDeviceType().trim().equalsIgnoreCase("Android")){	
											androidDevices.add(deviceTokenDetails.get(i).getDeviceToken());
											sendRecallNotificationToAndroid(message, deviceTokenDetails.get(i).getVin(), deviceTokenDetails.get(i).getDealerCode(), deviceTokenDetails.get(i).getDealerName(), androidDevices);
											logger.debug(">>Send push to ANDROID");
											androidDevices.remove(deviceTokenDetails.get(i).getDeviceToken());
											status=true;
										}
										else if(deviceTokenDetails.get(i).getDeviceType().trim().equalsIgnoreCase("iPhone")){	
											iPhoneDevices.add(deviceTokenDetails.get(i).getDeviceToken());
											sendRecallNotificationToIphone(message, deviceTokenDetails.get(i).getVin(), deviceTokenDetails.get(i).getDealerCode(), deviceTokenDetails.get(i).getDealerName(), iPhoneDevices);
											logger.debug(">>Send push to IPHONE");
											iPhoneDevices.remove(deviceTokenDetails.get(i).getDeviceToken());
											status=true;
										}
									}
								}
								else{
									status = true;
									logger.debug("In recallPushnotificaionData deviceTokenDetails : {}",deviceTokenDetails);
								}
							}	
							else{
								status = false;
								logger.debug("Update to mmgrecallpushdata failed");
							}
						}
						else{
							status=true;
							logger.debug("Recall push notification flag in property file set to false");
						}
					}
					else{
						status = false;
						logger.debug("Add or  update to mmgrecallpushdata failed");
					}		
			}
			
			if(status){
				pushNotificationSuccessStatus = "Y";
			}
			else{
				pushNotificationSuccessStatus = "N";
			}
			}
		
        } catch (Exception e) {
            logger.error("An Exception occured, while fetching open recall details ", e);
            e.printStackTrace();
        } finally {
			saveToMmgRecallHistory(pushNotificationCount,pushNotificationSuccessStatus);
			updateNotificationStatus("Y");
        	updateJobRunningStatus("N");
        }
		
		logger.debug("In recallPushnotificaionData status {}",status);
		return status;
	}
	

	private Map<String,String> buildRecallControlMap(List<MmgRecallControlTableVO> mmgRecallControlTableVOList ){
		
		Map<String,String> recallControlMap = new HashMap<String,String>();
		
		for(MmgRecallControlTableVO mmgRecallControlTableVO:mmgRecallControlTableVOList){
			if(mmgRecallControlTableVO.getParameter().equalsIgnoreCase(RecallJobControlParamEnum.MAXRECALL.getId())){
				recallControlMap.put(mmgRecallControlTableVO.getParameter(), mmgRecallControlTableVO.getValue());
			}
			if(mmgRecallControlTableVO.getParameter().equalsIgnoreCase(RecallJobControlParamEnum.RECALLSTATUS.getId())){
				recallControlMap.put(mmgRecallControlTableVO.getParameter(), mmgRecallControlTableVO.getValue());
			}
			if(mmgRecallControlTableVO.getParameter().equalsIgnoreCase(RecallJobControlParamEnum.THRESHOLDFREQ.getId())){
				recallControlMap.put(mmgRecallControlTableVO.getParameter(), mmgRecallControlTableVO.getValue());
			}
			if(mmgRecallControlTableVO.getParameter().equalsIgnoreCase(RecallJobControlParamEnum.TYPEOFRECALL.getId())){
				recallControlMap.put(mmgRecallControlTableVO.getParameter(), mmgRecallControlTableVO.getValue());
			}
			
		}
		
		return recallControlMap;
	}
	
	private ArrayList<DeviceTokenDetailsVO> getDeviceTokenDetails(){
		ArrayList<DeviceTokenDetailsVO> deviceTokenDetailsList = new ArrayList<DeviceTokenDetailsVO>();
		
		Connection conn=null;
		PreparedStatement stmt=null;
		ResultSet resultSet=null;
		
		try{
		conn=dataSource.getConnection();
		String query="SELECT md.device_token,pd.vin_cd,pd.cust_id,md.device_type,pd.crln_nm,pd.dealer_code,pd.dealer_name "
				+" FROM mmgrecallpushdata pd"
				+" inner join mmgusers mu on mu.mmgservicecustid=pd.cust_id"
				+" inner join mmg_devices md on md.device_user=mu.usermailid"
				+" WHERE pd.notification_flg='Y' and pd.notification_status='Y'";
		
		stmt=conn.prepareStatement(query);
		
		resultSet=stmt.executeQuery();
		
			while(resultSet.next())
			{
				DeviceTokenDetailsVO response = new DeviceTokenDetailsVO();
				response.setDeviceToken(resultSet.getString(1));
				response.setVin(resultSet.getString(2));
				response.setCustId(resultSet.getString(3));	
				response.setDeviceType(resultSet.getString(4));
				response.setCrlnName(resultSet.getString(5));
				response.setDealerCode(resultSet.getString(6));
				response.setDealerName(resultSet.getString(7));
				deviceTokenDetailsList.add(response);
			}
		
		}catch(Exception e){
			logger.error(" Problem -  getDeviceTokenDetails > "+e);
		}
		finally{
		    try { resultSet.close(); } catch (Exception e) { logger.error(e.getMessage());}
		    try { stmt.close(); } catch (Exception e) { logger.error(e.getMessage()); }
		    try { conn.close(); } catch (Exception e) { logger.error(e.getMessage()); }			
		}	
		
		logger.debug("In getDeviceTokenDetails - deviceTokenDetailsList size : {}",deviceTokenDetailsList.size());
		return deviceTokenDetailsList;
		
	}
	
