	 private boolean updateMmgRecallPushDataOnCtrlParams(Map<String,String> recallControlMap){
		 
		 logger.debug("<< Entering updateMmgRecallPushData()");
		 boolean updateStatus = false;
		 Connection conn=null;
		 Statement stmt=null;
		 ResultSet rs=null;
		 
		 try{
			 	int maxCount = Integer.parseInt(recallControlMap.get(RecallJobControlParamEnum.MAXRECALL.getId()));
			 	int thresholdFreq =Integer.parseInt(recallControlMap.get(RecallJobControlParamEnum.THRESHOLDFREQ.getId()));
			 	
				conn=dataSource.getConnection();
				conn.setAutoCommit(false);
				stmt=conn.createStatement();
				int rcllCount = 0;
				String lastNotificationDate = null;
				char notStatus = 'Y';
				String vin = null;
				String rcllNo = null;
				
				SimpleDateFormat sdf = new SimpleDateFormat("yyyy-MM-dd");
				Date today = new Date();

				//Select all records from mmgrecallpushdata
				//For every record check for maxcount and threshold frequency and update count,not status accordingly
				
				
				
				String selectQuery = "SELECT vin_cd,rcll_no,recall_count,last_notification_date FROM mmgrecallpushdata where notification_flg ='Y' and notification_status= 'Y'";
				rs = stmt.executeQuery(selectQuery);
				String updateQuery = "";
				
				while(rs.next()){
					
					vin = rs.getString(1);
					rcllNo = rs.getString(2);
					rcllCount = rs.getInt(3);
					lastNotificationDate = rs.getString(4);
					
					if(lastNotificationDate!=null){
						Date lastNotDate = sdf.parse(lastNotificationDate);
						Calendar cal = Calendar.getInstance();
						cal.setTime(lastNotDate);
						cal.add(Calendar.DATE, thresholdFreq); 
						lastNotDate = cal.getTime();
					
					if(rcllCount>=maxCount || lastNotDate.compareTo(today)>0){
						notStatus = 'N';
						logger.debug("Either max recall count reached or recall is in threshold freq limit for vin= {} and recall no= {}",vin,rcllNo);
						
						updateQuery = "UPDATE mmgrecallpushdata SET recall_count="+rcllCount+","+"notification_status="+"'"+notStatus+"'"
								+ " where rcll_no="+"'"+rcllNo+"'"+"  AND vin_cd="+"'"+vin+"'" ;
					}else{
						notStatus = 'Y';
						rcllCount += 1;
						updateQuery = "UPDATE mmgrecallpushdata SET recall_count="+rcllCount+","+"last_notification_date="+"CURRENT_DATE"+","+"notification_status="+"'"+notStatus+"'"
								+ " where rcll_no="+"'"+rcllNo+"'"+"  AND vin_cd="+"'"+vin+"'" ;
					}
					
					/*String updateQuery = "UPDATE mmgrecallpushdata SET recall_count="+rcllCount+","+"last_notification_date="+"CURRENT_DATE"+","+"notification_status="+"'"+notStatus+"'"
							+ " where rcll_no="+"'"+rcllNo+"'"+"  AND vin_cd="+"'"+vin+"'" ;*/
						stmt.addBatch(updateQuery);
					}
					else{
						String updateQueryForNewRecords = "UPDATE mmgrecallpushdata SET recall_count=1"+","+"last_notification_date="+"CURRENT_DATE"+","+"notification_status="+"'"+notStatus+"' "
								+ " where rcll_no="+"'"+rcllNo+"'"+"  AND vin_cd="+"'"+vin+"'" ;
						stmt.addBatch(updateQueryForNewRecords);
					}
			}
			int[] updateRow=stmt.executeBatch();
			conn.setAutoCommit(true);
			logger.debug(" No of affected rows in updateMmgRecallPushData - mmgrecallpushdata {} = ",updateRow);
			updateStatus = true;
				
		 }catch(Exception e){
			 	updateStatus = false;
				logger.error(" Updating failed -  updateMmgRecallPushData > "+e);
				try {
					conn.rollback();
					conn.setAutoCommit(true);
				} catch (SQLException e1) {
					e1.printStackTrace();
				}
			}finally{
			    try { stmt.close(); } catch (Exception e) { logger.error(e.getMessage()); }
			    try { conn.close(); } catch (Exception e) { logger.error(e.getMessage()); }			
			}
		 
		 logger.debug("<< Exiting updateMmgRecallPushData with status {}",updateStatus);
		 return updateStatus;
	 }
	 
