public void saveToMmgRecallHistory(int count,String recallStatus){
	
	Connection conn=null;
	PreparedStatement stmt=null;
	
	try{
		conn=dataSource.getConnection();
		String query="INSERT into mmgrecallhistory (recallPushNotificationDate,recallPushNotificationCount,recallSuccessStatus) "
				+ " VALUES (CURRENT_TIMESTAMP,"
				+count+",'"+recallStatus+"')";
		stmt=conn.prepareStatement(query);
	
		stmt.executeUpdate();
	
	}catch(Exception e){
		logger.error(" Problem -  getEligiblePushDataRecords > "+e);
	}
	finally{
	    try { stmt.close(); } catch (Exception e) { logger.error(e.getMessage()); }
	    try { conn.close(); } catch (Exception e) { logger.error(e.getMessage()); }			
	}
}

